import React from "react";
import "./_videoHorizontal.scss";

import { AiFillEye } from "react-icons/ai";
import request from "../../api";

import moment from "moment";
import numeral from "numeral";
import { LazyLoadImage } from "react-bootstrap";
import { Col, Row } from "react-bootstrap";

const seconds = moment.duration("100").asSeconds();
const _duration = moment.utc(seconds * 1000).format("mm:ss");

const VideoHorizontal = () => {
  return (
    <Row className="videoHorizontal m-1 py-2 align-items-center">
      <Col xs={6} md={4} className="videoHorizontal_left"></Col>

      <LazyLoadImage
        src="https://www.seoclerk.com/pics/319222-1IvI0s1421931178.png"
        effect="blur"
        className="videoHorizontal_thumbnail"
        wrapperClassName="VideoHorizontal_thumbnail-wrapper"
      />
      <span className="video_top_duration">{_duration}</span>
      <Col xs={6} md={8} className="videoHorizontal_right"></Col>
    </Row>
  );
};

export default VideoHorizontal;
